import React from 'react';
import Home from './components/Home';
import './App.css';
import { BrowserRouter, Route, Router, Link } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Home/>
      </Router>
    </div>
  );
}

export default App;
